#include "AUV.hpp"

void AUV::field(AD<double> t, vector< AD<double> >& x, vector< AD<double> >& u, vector< AD<double> >& y){
	double M1 = 13.2;
	double M3 = 25.6;
	double I = 0.12;
	y[0] = x[3]*cos(x[2])+x[4]*sin(x[2]);
	y[1] = x[4]*cos(x[2])-x[3]*sin(x[2]);
	y[2] = x[5];
	y[3] =-x[4]*x[5]*M3/M1 + u[0]/M1;
	y[4] = x[3]*x[5]*M1/M3 + u[1]/M3;
	y[5] = x[3]*x[4]*(M3-M1)/I + u[2]/I;
}
AD<double> AUV::cost(vector< AD<double> >& x, vector< AD<double> >& u){
	return 1;
}
void AUV::get_state_L(vector<double>& x_L){
	for(size_t i=0; i<get_M(); i++){
		x_L[i]=-1.0e19;
	}
}
void AUV::get_state_U(vector<double>& x_U){
	for(size_t i=0; i<get_M(); i++){
		x_U[i]=1.0e19;
	}
}
void AUV::get_control_L(vector<double>& u_L){
	for(size_t i=0; i<get_C(); i++){
		u_L[i]=-1;
	}
}
void AUV::get_control_U(vector<double>& u_U){
	for(size_t i=0; i<get_C(); i++){
		u_U[i]=1;
	}
}
void AUV::get_initial_state(vector<double>& x0){
	x0[0]=0;
	x0[1]=1;
	x0[2]=0;
	x0[3]=0;
	x0[4]=0;
	x0[5]=0;
}
void AUV::get_final_state(vector<double>& xF){
	xF[0]=2;
	xF[1]=1;
	xF[2]=0;
	xF[3]=0;
	xF[4]=0;
	xF[5]=0;
}
size_t AUV::get_N(){
	return 50; // discretization steps
}
size_t AUV::get_M(){
	return 6; // dimension of states
}
size_t AUV::get_C(){
	return 3; // dimension of control
}

